import { Component } from "react";
import BubbleAlert from "./BubbleAlert";
const styles = {
    button: {
        backgroundColor: '#fff', 
        color: '#3e2623',
        border: 'none',
        padding:'15px',
        cursor: 'pointer',



    },
    carro: {
        width: '50px',
    },
    bubble: {
        position: 'relative',
        left: '12px',

    }
}

class Carro extends Component{
    render() {
        return (
            <div>
                <span style={styles.bubble}><BubbleAlert/></span>
                <button style={styles.button }><img style={styles.carro } src="/img/carro-de-compras-rapido.png" alt="Carrito de compras" /></button>
            </div>
        )
    }
}
export default Carro
